import styled from "styled-components";

const RowC = styled.div`
  width: ${({ width }) => width}%;
`;

const Row = ({ primary, dataPrimary, widthCells, rowData }) => {
  return <> {primary ? <></> : <></>} </>;
};

export default Row;
